import React, { useState } from "react";
import { Label } from "reactstrap";

export default function ShippingInfoPage(props){

    const shippingNavHandler = () => {
        props.setCustomerNav(false);
        props.setShippingNav(false);
        props.setPaymentNav(true);
    }

    const backSNavHandler = () => {
        props.setCustomerNav(true);
        props.setShippingNav(false);
        props.setPaymentNav(false);
    }

    return (
        <div style={{padding:0}}>
            <div>
                <Label style={{fontSize:24, padding:'10px 0px'}}>Shipping Information</Label>
                <div>
                    <div></div>
                    <div></div>
                </div>
            </div>

            {/* shipping method */}
            <div>
                <Label style={{fontSize:24, padding:'10px 0px'}}>Shipping Method</Label>
                <div>
                    <div></div>
                    <div></div>
                </div>

            </div>

            <div>
                <span style={{cursor:'pointer'}} onClick={() => backSNavHandler()}>Back to Customer Info</span>
                <button onClick={() => shippingNavHandler()}>CONTINUE TO PAYMENT</button>
            </div>
        </div>
    )
}
